import "./styles/style.css";
import img from "./images/imageNotFound.png";
import Header from "./components/header/Header";
import Inputs from "./components/inputs/Inputs";
import Footer from "./components/footer/Footer";
import Card from "./components/cards/Card";
import { books } from "./helpers/cardsList";


function App() {
  return (
    <div className="App">
      <Header />
      <main className="main">
        {/*<Inputs />*/}

        <section className="cards__catalog" id="cardsCatalog">
          {books.map((eachBook) => {
            let imageURL = "./images/imageNotFound.png";
            if (eachBook.image) {
              imageURL = eachBook.image;
            };
            const idKey = eachBook.id;
             return <Card key={idKey} title={eachBook.title} img ={imageURL} author={eachBook.author} price={eachBook.price} />
          })}

        </section>

      </main>
      <Footer />
    </div>
  );
}

export default App;
